import React, { useEffect,useState } from 'react';
import axios from 'axios';
function Book() {
  const [doctors, setDoctors] = useState("");
    useEffect(() => {
        axios.get('/dataload')
        .then(response => {
          setDoctors(response.data);
        })
        .catch(error => {
          console.log(error);
        })
      }, []);
    return(
        <div className="App">
      {doctors.map(doc => (
            <div key={doc._id}>
              {doc.name}
              {doc.message}
            </div>
        ))}
        </div>
    );
}
export default Book;
